  "sources": {
    "contracts/Blocksafu.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./interfaces/IERC20.sol";
import "./interfaces/IUniswapV2Factory.sol";
import "./interfaces/IUniswapV2Router02.sol";
import "./interfaces/IWETH.sol";
import "./interfaces/IBlockstaking.sol";
import "./libraries/SafeMath.sol";
import "./libraries/Context.sol";
import "./libraries/Auth.sol";
import "hardhat/console.sol";

contract Blocksafu is Context, Auth, IERC20 {
    using SafeMath for uint256;

    //ERC20
    uint8 private _decimals = 18;
    uint256 private _totalSupply = 1_000_000_000 * (10**_decimals);
    string private _name = "BlockSAFU";
    string private _symbol = "BSAFU";
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    //Tokenomic Buy
    uint256 public percentBuyStaking = 100;
    uint256 public percentBuyReferral = 100;
    uint256 public percentBuyOperational = 100;
    uint256 public percentBuyTreasury = 100;
    //Tokenomic Sell
    uint256 public percentSellStaking = 250;
    uint256 public percentSellMarketing = 250;
    uint256 public percentSellOperational = 200;
    uint256 public percentSellTreasury = 200;

    uint256 public percentTaxDenominator = 10000;
    uint256 public minimumSwapForWeth = 10000000000;
    uint256 public minimumWethForTreasuryAndBurn = 1000000000000000000; //1 BNB
    uint256 public minimumTokenForAddLiquidity = 10000000000;
    uint256 public minimumTokenLeft = 1;
    uint256 public minimumTimeBuy = 1 minutes;
    uint256 public minimumTimeSell = 1 minutes;
    uint256 public maximumAmountPerWallet = _totalSupply;

    bool public isAutoSwapForWeth = true;
    bool public isTaxBuyEnable = true;
    bool public isTaxSellEnable = true;
    bool public isAutoTreasuryAndBurn = false;
    bool public isAutoAddLiquidity = false;
    bool public isHasMinimumTokenLeft = true;
    bool public isLastTimeBuyEnable = false;
    bool public isLastTimeSellEnable = false;
    bool public isMaxAmountPerWalletEnable = true;
    bool public isStakingEnable = true;
    bool public isSetAutoStakingEnable = true;
    // uint256
    mapping(address => bool) public isExcludeFromFee;
    mapping(address => bool) public isRecipientExcludeFromFee;
    mapping(address => bool) public isExcludeFromTimeBuyLimit;
    mapping(address => bool) public isExcludeFromMaxAmountPerWallet;
    mapping(address => address) public referralAddress;
    mapping(address => uint256) public lastTimeBuy;
    mapping(address => uint256) public lastTimeSell;

    //address
    address public factoryAddress;
    address public wethAddress;
    address public routerAddress;
    address public marketingAddress = 0x2Ce7369d0Bf30A8FCA0a77376da0de196CB0C7EE;
    address public operationalAddress = 0x06523C7ae9e41b69CD6889973Fc600Fb3513FD07;
    address public routerStakingAddress = 0x7B52bdE0D53D8Dc78E65e518d30De883400B3e01;
    address ZERO = 0x0000000000000000000000000000000000000000;
    address DEAD = 0x000000000000000000000000000000000000dEaD;

    mapping(address => bool) public isPair;

    event TreasuryAndBurn(uint256 amountETH, uint256 amountToken);
    event AddLiquidity(uint256 amountETH, uint256 amountToken);

    bool inSwap;

    modifier swapping() {
        inSwap = true;
        _;
        inSwap = false;
    }

    constructor(
      address _routerAddress
    ) Auth(msg.sender) {

      routerAddress = _routerAddress;

      wethAddress = IUniswapV2Router02(routerAddress).WETH();
      factoryAddress = IUniswapV2Router02(routerAddress).factory();
      IUniswapV2Factory(factoryAddress).createPair(address(this), wethAddress);
      address pairWETH = IUniswapV2Factory(factoryAddress).getPair(address(this), wethAddress);
      isPair[pairWETH] = true;

      isExcludeFromFee[msg.sender] = true;
      isExcludeFromFee[routerAddress] = true;
      isExcludeFromTimeBuyLimit[msg.sender] = true;
      isExcludeFromMaxAmountPerWallet[msg.sender] = true;
      isExcludeFromMaxAmountPerWallet[routerAddress] = true;
      isExcludeFromMaxAmountPerWallet[pairWETH] = true;
      isExcludeFromTimeBuyLimit[routerAddress] = true;
      isExcludeFromTimeBuyLimit[pairWETH] = true;

      _approve(address(this), routerAddress, _totalSupply);

      _balances[msg.sender] = _totalSupply;
      emit Transfer(address(0), msg.sender, _totalSupply);
    }

    receive() external payable {}

    function name() public view override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function getOwner() public view virtual override returns (address) {
        return _getOwner();
    }

    function balanceOf(address account)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        if (_allowances[sender][msg.sender] != _totalSupply) {
            _allowances[sender][msg.sender] = _allowances[sender][msg.sender]
                .sub(amount, "Blocksafu: Insufficient Allowance");
        }
        _transfer(sender,recipient,amount);
        return true;
    }


    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender] + addedValue
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(
            currentAllowance >= subtractedValue,
            "Blocksafu: decreased allowance below zero"
        );
        unchecked {
            _approve(_msgSender(), spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "Blocksafu: approve from the zero address");
        require(spender != address(0), "Blocksafu: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual {
      _beforeTransferToken(sender, recipient, amount);
      if(shouldTakeFee(sender, recipient)){
        _complexTransfer(sender, recipient, amount);
      } else {
        _basicTransfer(sender, recipient, amount);
      }
      _afterTransferToken(sender, recipient, amount);
    }

    function _basicTransfer(address sender, address recipient, uint256 amount) internal {
      _balances[sender] = _balances[sender].sub(amount);
      _balances[recipient] = _balances[recipient].add(amount);
      emit Transfer(sender, recipient, amount);
    }

    function _complexTransfer(address sender, address recipient, uint256 amount) internal {
      uint256 amountTransfer = getAmountTransfer(amount, sender, recipient);

      if(shouldSwapForWeth(sender)) _swapForWeth(_balances[address(this)]);
      if(shouldAutoAddLiquidity(sender)) _swapAndLiquify();

      _balances[sender] = _balances[sender].sub(amount);
      _balances[recipient] = _balances[recipient].add(amountTransfer);
      emit Transfer(sender, recipient, amount);
    }

    function _beforeTransferToken(address sender, address recipient, uint256 amount) internal view {
      if(isPair[sender]){
        if(isLastTimeBuyEnable && !isExcludeFromTimeBuyLimit[recipient] && lastTimeBuy[recipient] > 0){
          require(block.timestamp.sub(lastTimeBuy[recipient]) >= minimumTimeBuy,"Blocksafu: Minimum Time Buy is Exceed");
        }
      } else {
        if(isLastTimeSellEnable){
          require(block.timestamp.sub(lastTimeSell[sender]) >= minimumTimeSell,"Blocksafu: Minimum Time Sell is Exceed");
        }
      }
    }

    function _afterTransferToken(address sender, address recipient, uint256 amount) internal {
      lastTimeBuy[recipient] = block.timestamp;
      lastTimeSell[sender] = block.timestamp;

      if(isMaxAmountPerWalletEnable && !isExcludeFromMaxAmountPerWallet[recipient]){
        require(_balances[recipient] <= maximumAmountPerWallet,"Blocksafu: Maximum Amount Per Wallet is exceed");
      }
    }

    function shouldSetAutoStaking(address sender) internal returns(bool){
        return (isSetAutoStakingEnable && !isPair[sender] && !inSwap);
    }

    function getAmountTransfer(uint256 amount, address sender, address recipient) internal returns(uint256){
      uint256 percentTotalTax;
      uint256 amountTax;
      uint256 amountReferral;
      if(isPair[sender]) {
        if(referralAddress[recipient] != address(0)) {
          percentTotalTax = percentBuyTreasury.add(percentBuyOperational).add(percentBuyStaking);
          amountReferral = amount.mul(percentBuyReferral).div(percentTaxDenominator);
        } else {
          percentTotalTax = percentBuyReferral.add(percentBuyTreasury).add(percentBuyOperational).add(percentBuyStaking);
        }
      } else {
        percentTotalTax = percentSellMarketing.add(percentSellTreasury).add(percentSellOperational).add(percentSellStaking);
      }
      amountTax = amount.mul(percentTotalTax).div(percentTaxDenominator);

      if(amountReferral > 0) {
        _balances[referralAddress[recipient]] =_balances[referralAddress[recipient]].add(amountReferral);
      }
      _balances[address(this)] = _balances[address(this)].add(amountTax.sub(amountReferral));

      emit Transfer(sender, address(this), amount);
      if(isHasMinimumTokenLeft && !isPair[sender] && _balances[sender].sub(amount) < minimumTokenLeft) {
        _balances[sender] = _balances[sender].add(minimumTokenLeft);
        return amount.sub(amountTax).sub(amountReferral).sub(minimumTokenLeft);
      } else {
        return amount.sub(amountTax).sub(amountReferral);
      }
    }

    function burn(uint256 amount) external {
        require(_balances[_msgSender()] >= amount,"Blocksafu: Insufficient Amount");
        _burn(_msgSender(), amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        _balances[account] = _balances[account].sub(amount);
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, DEAD, amount);
    }

    function shouldTakeFee(address sender, address recipient) internal view returns(bool){
      if(inSwap) return false;
      if(isExcludeFromFee[sender]) return false;
      if(isRecipientExcludeFromFee[recipient]) return false;
      if(isPair[sender] && !isTaxBuyEnable) return false;
      if(isPair[recipient] && !isTaxSellEnable) return false;
      return true;
    }

    function shouldSwapForWeth(address sender) internal view returns(bool){
      return (isAutoSwapForWeth && !isPair[sender] && !inSwap && _balances[address(this)] >= minimumSwapForWeth); 
    }

    function shouldAutoAddLiquidity(address sender) internal view returns(bool){
      return (isAutoAddLiquidity && !inSwap && !isPair[sender] && address(this).balance >= minimumTokenForAddLiquidity);
    }

    function shouldTreasuryAndBurn(address sender) internal view returns(bool){
      return (isAutoTreasuryAndBurn && !inSwap && !isPair[sender] && address(this).balance >= minimumWethForTreasuryAndBurn);
    }

    function setIsPair(address pairAddress, bool state) external onlyOwner {
      isPair[pairAddress] = state;
    }

    function setMinimumTokenLeft(bool state, uint256 _minimumTokenLeft) external onlyOwner {
      require(_minimumTokenLeft <= (25000*(10**_decimals)),"Blocksafu: Max Amount Exceed");
      isHasMinimumTokenLeft = state;
      minimumTokenLeft = _minimumTokenLeft;
    }

    function setTaxReceiver(address _marketingAddress, address _operationalAddress) external onlyOwner {
      marketingAddress = _marketingAddress;
      operationalAddress = _operationalAddress;
    }

    function setReferral(address parent, address child) external authorized {
      referralAddress[child] = parent;
    }

    function setRouterStakingAddress(address _routerStakingAddress) external onlyOwner {
      routerStakingAddress = _routerStakingAddress;
      isRecipientExcludeFromFee[_routerStakingAddress] = true;
      isExcludeFromFee[_routerStakingAddress] = true;
      isExcludeFromMaxAmountPerWallet[_routerStakingAddress] = true;
      isExcludeFromTimeBuyLimit[_routerStakingAddress] = true;
    }

    function setIsTaxEnable(bool taxBuy, bool taxSell) external onlyOwner {
      isTaxBuyEnable = taxBuy;
      isTaxSellEnable = taxSell;
    }

    function setIsExcludeFromFee(address account, bool state) external authorized {
      isExcludeFromFee[account] = state;
    }

    function setIsRecipientExcludeFromFee(address account, bool state) external authorized {
      isRecipientExcludeFromFee[account] = state;
    }

    function setAutoSwapForWeth(bool state,uint256 amount) external onlyOwner {
      require(amount <= _totalSupply,"Blocksafu: Amount Swap For Weth max total supply");
      isAutoSwapForWeth = state;
      minimumSwapForWeth = amount;
    }

    function setTimeBuy(bool state,uint256 time) external onlyOwner {
      require(time <= 1 hours ,"Blocksafu: Maximum Time Buy is 1 hours");
      isLastTimeBuyEnable = state;
      minimumTimeBuy = time;
    }

    function setTimeSell(bool state,uint256 time) external onlyOwner {
      require(time <= 24 hours ,"Blocksafu: Maximum Time Sell is 1 hours");
      isLastTimeSellEnable = state;
      minimumTimeSell = time;
    }

    function setMaxAmountPerWallet(bool state, uint256 amount) external onlyOwner{
        isMaxAmountPerWalletEnable = state;
        maximumAmountPerWallet = amount;
    }

    function setIsExcludeFromMaxAmountPerWallet(bool state, address account) external onlyOwner {
        isExcludeFromMaxAmountPerWallet[account] = state;
    }

    function setIsExcludeTimeBuy(bool state, address _account) external onlyOwner {
      isExcludeFromTimeBuyLimit[_account] = state;
    }

    function setAutoTreasuryAndBurn(bool state,uint256 _minimumWethForTreasuryAndBurn) external onlyOwner {
      isAutoTreasuryAndBurn = state;
      minimumWethForTreasuryAndBurn = _minimumWethForTreasuryAndBurn;
    }

    function setAutoAddLiquidity(bool state, uint256 amountToken) external onlyOwner {
      isAutoAddLiquidity = state;
      minimumTokenForAddLiquidity = amountToken;
    }

    function setStakingEnable(bool state) external onlyOwner {
        isStakingEnable = state;
    }

    function setAutoStakingEnable(bool state) external onlyOwner {
        isSetAutoStakingEnable = state;
    }

    function setPercentBuy(uint256 _percentStaking, uint256 _percentReferral, uint256 _percentOperational, uint256 _percentTreasury) external onlyOwner {
      require(_percentStaking <= 600,"Blocksafu: Maximum 6%");
      require(_percentReferral <= 600,"Blocksafu: Maximum 6%");
      require(_percentOperational <= 600,"Blocksafu: Maximum 6%");
      require(_percentTreasury <= 600,"Blocksafu: Maximum 6%");
      percentBuyStaking = _percentStaking;
      percentBuyReferral = _percentReferral;
      percentBuyOperational = _percentOperational;
      percentBuyTreasury = _percentTreasury;
    } 

    function setPercentSell(uint256 _percentStaking, uint256 _percentMarketing, uint256 _percentOperational, uint256 _percentTreasury) external onlyOwner {
      require(_percentStaking <= 600,"Blocksafu: Maximum 6%");
      require(_percentMarketing <= 600,"Blocksafu: Maximum 6%");
      require(_percentOperational <= 600,"Blocksafu: Maximum 6%");
      require(_percentTreasury <= 600,"Blocksafu: Maximum 6%");
      percentSellStaking = _percentStaking;
      percentSellMarketing = _percentMarketing;
      percentSellOperational = _percentOperational;
      percentSellTreasury = _percentTreasury;
    }  

    function _buyToken(uint256 amount, address to) internal swapping {
      IUniswapV2Router02 router = IUniswapV2Router02(routerAddress);
      address[] memory path = new address[](2);
      path[0] = wethAddress;
      path[1] = address(this);

      router.swapExactETHForTokensSupportingFeeOnTransferTokens{value:amount}(
        0,
        path, 
        to, 
        block.timestamp.add(300)
      );
    }


    function _swapForWeth(uint256 amount) internal swapping {
      if(amount > 0) {
        uint256 totalTax = percentSellMarketing.add(percentSellTreasury).add(percentSellOperational).add(percentSellStaking);
        uint256 amountTokenForLiquify = amount.mul(percentSellOperational.mul(percentTaxDenominator).div(totalTax)).div(percentTaxDenominator);
        uint256 amountHalfTokenForLiquify = amountTokenForLiquify.div(2); //half token for swap to WETH
        uint256 amountSwapForWeth = amount.sub(amountHalfTokenForLiquify); //total amount token for liquify

        IUniswapV2Router02 router = IUniswapV2Router02(routerAddress);

        uint256 balanceETHBefore = address(this).balance;

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = wethAddress;

        uint256[] memory estimate = router.getAmountsOut(amountSwapForWeth, path);

        uint256 amountForSwap = estimate[1];

        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            amountSwapForWeth,
            amountForSwap,
            path,
            address(this),
            block.timestamp
        );

        uint256 balanceETHAfter = address(this).balance.sub(balanceETHBefore);

        //distribute
          uint256 amountMarketing = getAmountPercent(balanceETHAfter,percentSellMarketing,totalTax);
          uint256 amountStaking = getAmountPercent(balanceETHAfter,percentSellStaking,totalTax);
          uint256 amountDev = getAmountPercent(balanceETHAfter,percentSellTreasury,totalTax);
        payable(marketingAddress).transfer(amountMarketing);
          if(isStakingEnable){
              IBlockstaking(routerStakingAddress).deposit{value:amountStaking}();
          }
        payable(operationalAddress).transfer(amountDev);
      }
    }

    function getAmountPercent(uint256 baseAmount, uint256 taxAmount, uint256 divider) internal returns(uint256){
        return baseAmount.mul(taxAmount.mul(percentTaxDenominator).div(divider)).div(percentTaxDenominator);
    }

    function swapForWeth(uint256 amount) external onlyOwner {
      _swapForWeth(amount);
    }

    function _swapAndLiquify() internal swapping {
      uint256 amountETH = address(this).balance;
      uint256 amountToken = _balances[address(this)];
      _addLiquidity(amountToken,amountETH);
      emit AddLiquidity(amountETH, amountToken);
    }

    function _addLiquidity(uint256 amountToken, uint256 amountETH) internal {
      IUniswapV2Router02 router = IUniswapV2Router02(routerAddress);
      router.addLiquidityETH{value: amountETH}(
        address(this),
        amountToken,
        0,
        0,
        owner,
        block.timestamp
      );
    }

    function claimWeth(address to, uint256 amount) external onlyOwner {
      payable(to).transfer(amount);
    }

    function claimFromContract(address _tokenAddress, address to, uint256 amount) external onlyOwner {
      IERC20(_tokenAddress).transfer(to, amount);
    }
}"
    },
